import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import Users from "./user/pages/Users";
import NewPlace from "./places/pages/NewPlace";

function App() {
  return (
    <Router>
      <Route path="/">
        <Users />
      </Route>
      <Route path="/places/new">
        <NewPlace />
      </Route>
    </Router>
  );
}

export default App;
